import { FishFoodIcon } from "@hugeicons/react";
import { BananaIcon } from "@hugeicons/react";
import { Plant01Icon } from "@hugeicons/react";

import styles from "./styles.module.css";

const Bar = ({ species, name, medication, food }) => {
  return (
    <div className={styles.bar}>
      <input type="checkbox" />
      <p>{species}</p>
      <p>{name}</p>
      <p>{medication}</p>
      {food === "grass" ? (
        <Plant01Icon
          className={styles.icon}
          size={24}
          color={"#737373"}
          variant={"stroke"}
        />
      ) : food === "fruit" ? (
        <BananaIcon
          className={styles.icon}
          size={24}
          color={"#737373"}
          variant={"stroke"}
        />
      ) : (
        <FishFoodIcon
          className={styles.icon}
          size={24}
          color={"#737373"}
          variant={"stroke"}
        />
      )}
    </div>
  );
};

export default Bar;
